export const student = {
    id: 1,
    name: 'Danil',
    age: '27',
    isActive: true,
    address: {
        streetTitle: 'Surganova 2',
        city: {
            title: "Minsk",
            countryTitle: 'Belarus',
        }
    },
    technologies: [
        {
            id: 1,
            title: "HTML"
        },
        {
            id: 2,
            title: "CSS"
        },
        {
            id: 3,
            title: "JS"
        },

    ]
}

